import React from "react";

// MUI imports
import Box from "@mui/material/Box";
import Chip from "@mui/material/Chip";
import Stack from "@mui/material/Stack";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";

const PlayerInfo = (props) => {
  // Destructure props
  const { info } = props;

  return (
    <Box sx={{ pt: 2 }}>
      <Stack direction="row" spacing={1}>
        {info && info.alternateCaptain && <Chip label="Alternate Captain" />}
        {info && info.captain && <Chip label="Captain" />}
        {info && info.rookie && <Chip label={`Age: ${info.currentAge}`} />}
        {info && <Chip label={`Age: ${info.currentAge}`} />}
        {info && <Chip label={`Height: ${info.height}`} />}
        {info && <Chip label={`Weight: ${info.weight}`} />}
        {info && <Chip label={`Shoots: ${info.shootsCatches}`} />}
      </Stack>
      <Grid container spacing={2}>
        <Grid item xs={2}>
          <Typography>xs=8</Typography>
        </Grid>
        <Grid item xs={10}>
          <Typography>xs=4</Typography>
        </Grid>
      </Grid>
    </Box>
  );
};

export default PlayerInfo;
